      SELECT DISTINCT * FROM tab0 (FORMAT parquet) AS cor0 WHERE NOT + col0 * col1 IS NOT NULL AND ( NULL ) NOT BETWEEN - ( - - CAST ( + col1 AS REAL ) ) * 53 + - col2 + - col2 / + col1 * + - 14 AND NULL;
  - name: tab0

outputs:
  - name: q4.out
    data: |
